// Importowanie potrzebnych zależności z biblioteki React
import React, { useState } from 'react';
import './App.css';  // Importowanie pliku CSS

// Komponent ContactForm
function ContactForm() {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Tu możesz dodać logikę zapisywania danych
    console.log('Form data submitted:', formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" value={formData.name} onChange={handleChange} placeholder="Imię" />
      <input type="tel" name="phone" value={formData.phone} onChange={handleChange} placeholder="Telefon" />
      <input type="email" name="email" value={formData.email} onChange={handleChange} placeholder="Email" />
      <textarea name="message" value={formData.message} onChange={handleChange} placeholder="Co jest popsute?" />
      <button type="submit">Wyślij</button>
    </form>
  );
}

// Komponent Gallery
function Gallery() {
  const images = [
    process.env.PUBLIC_URL + '/images/photo1.jpg',
    process.env.PUBLIC_URL + '/images/photo2.jpg',
    // ... (dodaj więcej ścieżek do zdjęć, jeśli są dostępne)
  ];

  return (
    <div className="gallery">
      {images.map((image, index) => (
        <img key={index} src={image} alt={`Example ${index + 1}`} />
      ))}
    </div>
  );
}

// Główny komponent App
function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Logo, nazwa warsztatu, dane kontaktowe */}
      </header>
      <section className="App-services">
        {/* Opis usług */}
      </section>
      <ContactForm />
      <Gallery />
      <footer className="App-footer">
        {/* Informacje prawne, media społecznościowe, mapa */}
      </footer>
    </div>
  );
}

// Eksportowanie głównego komponentu App, aby mógł być używany w innych częściach projektu
export default App;
